const UserForm = () => {
    return(
        <form>
            <input name="name" autoComplete="off" placeholder="name"></input>
            <input name="email" autoComplete="off" placeholder="email"></input>
            <label>
            <input name="phone" autoComplete="off" placeholder="phone"></input>
            </label>
        </form>
    )
}

export default UserForm;
